import './App.css';
import DataOutput from './components/dataOutput';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Get the track analysis data from any track on Spotify</h1>
        <DataOutput />
      </header>
    </div>
  );
}

export default App;
